import React from "react";
import LogoGosto from "../../images/images/GOSTO.png";
import BannerBeTrai from "../../images/images/BETrai.jpg";
import BannerBeGai from "../../images/images/BEGai.jpg";
import "./Home.css";
import Header from "../../component/header/header";
import SliderHome from "../../component/SliderHome/SliderHome";
import Footer from "../../component/footer/footer";
import Announcement from "../../component/announcement/announcement";
import Banner from "../../component/banner/banner";
import ProductsHome from "../../component/ProductsHome/ProductsHome";
import HomeBanner from "../../component/banner/HomeBanner/HomeBanner";

export default function Home() {
  return (
    <>
      <Header />
      <SliderHome />
      <Announcement />
      <Banner />
      {/* name là tên của loại sản phẩm , url là đường dẫn trang , visible and color là thuộc tính css riêng biệt của từng page */}
      <ProductsHome name="NAM" url="#" visible="none" />
      <ProductsHome name="NỮ" url="#" visible="none" />
      <ProductsHome name="PHỤ KIỆN" url="#" visible="none" />
      <ProductsHome logo={LogoGosto} url="#" color="white" />
      <HomeBanner />
      <ProductsHome name="BÉ TRAI" url="#" visible="none" />
      <HomeBanner />
      <ProductsHome name="BÉ GÁI" url="#" visible="none" />
      <Footer />
    </>
  );
}
